import React from "react";
import LoginButton from "../../components/loginButton";
import styles from "./index.module.css";
import {
  Image,
  Box,
  Text,
  Center,
  StylesProvider,
  VStack,
} from "@chakra-ui/react";

function Login() {
  return (
    <VStack spacing={10} align="center">
      {" "}
      <Box>
        <Center>
          <Box flexShrink={0}>
            <main>
              <LoginButton />
            </main>
          </Box>
        </Center>
      </Box>
    </VStack>
  );
}

export default Login;

